import axios from 'axios';

const getFeedbackByIdService = (fid) => {
    console.log(`getFeedbackByIdService`);
    return axios.get(`/viewFeedBack/${fid}`);
}

const getAllFeeService = () => {
    console.log(`getNgoByIdService`);
    return axios.get(`getallngo`);
}


export { getFeedbackByIdService};
